/* eslint-disable no-unused-vars */
import React from "react";
import { createStackNavigator } from '@react-navigation/stack';

import Splash from "../screens/Splash";
// Login
import Login from "../screens/Login";
import ResetEmail from "../screens/Login/ResetEmail";
import EmailVerification from "../screens/Login/EmailVerification";
import ResetPassword from "../screens/Login/ResetPassword";
import SuccessfulReset from "../screens/Login/SuccessfulReset";
import FailedReset from "../screens/Login/FailedReset";
import UpdatePassword from "../screens/Login/UpdatePassword";
import SuccessfulUpdate from "../screens/Login/SuccessfulUpdate";
import FailedUpdate from "../screens/Login/FailedUpdate";
import WaivedPassword from "../screens/Login/WaivedPassword";
import KeepSecure from "../screens/Login/KeepSecure";

// Onboarding
import Onboarding from "../screens/Onboarding";
import EmergencyFund from "../screens/Onboarding/EmergencyFund";
import InterestRateInfo from "../screens/Onboarding/InterestRateInfo";
import FullName from "../screens/Onboarding/FullName";
import Nickname from "../screens/Onboarding/NickName";
import BirthDate from "../screens/Onboarding/BirthDate";
import Fatca from "../screens/Onboarding/Fatca";
import Gender from "../screens/Onboarding/Gender";
import MobileNumber from "../screens/Onboarding/mobileNumber";
import Otp from "../screens/Onboarding/otp";
import Email from "../screens/Onboarding/Email";
import Password from "../screens/Onboarding/Password";
import TermsAndPrivacyPolicy from "../screens/Onboarding/TermsAndPrivacyPolicy";
import OnboardingEmailVerification from "../screens/Onboarding/EmailVerification";
import OnYourWaySuccess from "../screens/Onboarding/Success";

// Profile
import Profile from "../screens/Profile";
import ProfileCustomerId from "../screens/Profile/CustomerId";
import ProfileInformation from "../screens/Profile/Information";
import Address from "../screens/Profile/Address";
import PasswordSecurity from "../screens/Profile/PasswordSecurity";
import ProfileNickname from "../screens/Profile/Nickname";
import ProfileMobile from "../screens/Profile/Mobile";
import ProfileOtp from "../screens/Profile/Otp";
import CommunicationPreference from "../screens/Profile/CommunicationPreference";
import ProfileChangePassword from "../screens/Profile/ChangePassword";
import ProfileEmailVerification from "../screens/Profile/EmailVerification";
import ProfileChangePasswordSuccess from "../screens/Profile/ChangePasswordSuccess";
import ProfileChangePasswordFailed from "../screens/Profile/ChangePasswordFailed";

const Stack = createStackNavigator();

function Navigation() {
  return (
    <Stack.Navigator>
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="Splash" component={Splash} />

      {/* Login */}
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="Login" component={Login} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ResetEmail" component={ResetEmail} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="EmailVerification" component={EmailVerification} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ResetPassword" component={ResetPassword} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="SuccessResetPassword" component={SuccessfulReset} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="FailedResetPassword" component={FailedReset} />

      {/* Onboarding */}
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="Onboarding" component={Onboarding} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="OnboardingEmergencyFund" component={EmergencyFund} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="OnboardingInterestRate" component={InterestRateInfo} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="OnboardingCreateAccount" component={FullName} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="OnboardingNickname" component={Nickname} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="OnboardingBirthdate" component={BirthDate} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="OnboardingFatca" component={Fatca} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="OnboardingGender" component={Gender} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="OnboardingMobile" component={MobileNumber} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="OnboardingOtp" component={Otp} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="Email" component={Email} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="Password" component={Password} />

      {/* Profile */}
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="Profile" component={Profile} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ProfileCustomerId" component={ProfileCustomerId} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ProfileInformation" component={ProfileInformation} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ProfileMobile" component={ProfileMobile} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ProfileOTP" component={ProfileOtp} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ProfileComPreference" component={CommunicationPreference} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ProfileChangePassword" component={ProfileChangePassword} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ProfileEmailVerification" component={ProfileEmailVerification} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ProfileChangePasswordSuccess" component={ProfileChangePasswordSuccess} />
      <Stack.Screen options={{ headerShown: false, animationEnabled: false }} name="ProfileChangePasswordFailed" component={ProfileChangePasswordFailed} />
    </Stack.Navigator>
  );
}

export default Navigation;
